import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { environment } from 'src/app/enviroment/environment';
import { Carrito } from 'src/app/domain/carrito';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class CarritoService {

  constructor(private http: HttpClient) { }

  getCarritos(){
    let url = `${environment.WS_PATH}/carritos/list/`;
    return this.http.get<Carrito[]>(url);
  }


  saveCarrito(carrito: Producto[]): Observable<any> {
    const url = `${environment.WS_PATH}/carrito/guardar`;
    return this.http.post(url, carrito);
  }
}
